import SwiftUI

/*
 iOS17+
 - Swift Macro
 - @Observable
 - @Bindable
 - 반복되는 코드를 줄이자
 - 컴파일러에 기능을 추가
 
 iOS18+
 
 - transition effect
 - @previewable
 - SwiftData Query
 
 */

struct PhotoView: View {
    @Namespace private var sean
    var body: some View {
        NavigationStack {
            VStack {
                ForEach(ImageList.list, id: \.id) { item in
                    Text(item.id.uuidString)
                    NavigationLink(value: item) {
                        AsyncImage(url: URL(string: item.url)) {
                            $0.image?
                                .resizable()
                                .scaledToFit()
                        }
                        // 돌아올 식별자로 지정
                        .matchedTransitionSource(id: item, in: sean)
                    }
                }
            }
            .navigationTitle("홈")
            .navigationDestination(for: ImageList.self) { model in
                PhotoDetailView(phoro: model)
                    .navigationTransition(.zoom(sourceID: model, in: sean))
            }
        }
    }
}

struct PhotoDetailView: View {
    let phoro: ImageList
    var body: some View {
        VStack {
            Text(phoro.id.uuidString)
            AsyncImage(url: URL(string: phoro.url)) {
                $0.image?
                    .resizable()
                    .scaledToFit()
            }
        }
    }
}

#Preview {
    PhotoView()
}

struct ImageList: Hashable, Identifiable {
    let id = UUID()
    let url: String
    
    static let list = [
        ImageList(url: "data:image/webp;base64,"),
        ImageList(url: "data:image/webp;base64,"),
        ImageList(url: "data:image/webp;base64,")
    ]
}
